l accumulations ranging from up to 3 inches in the lower\nelevations, to 5 to 12 inches above 3500 feet, especially in\nplaces like Beech Mountain, Mount Rogers and Flattop Mountain.\nWinds gusting as high as 50 mph.\n\n* WHERE...In North Carolina, Ashe and Watauga Counties. In Virginia,\nGrayson and Smyth Counties.\n\n* WHEN...Until midnight EST Monday Night.\n\n* IMPACTS...Roads, and especially bridges and overpasses, will\nlikely become slick and hazardous. Visibilities may drop below 1/4\nmile due to falling and blowing snow. Travel could be very\ndifficult. The hazardous conditions could impact the Monday\nmorning and evening commutes. Strong winds could cause tree damage.\n\n* ADDITIONAL DETAILS...Temperatures falling into the teens tonight,\ncombined with the wind, will result in wind chills near zero late\ntonight and Monday.", "effective": "2026-02-22T17:21:00-05:00", "ends": "2026-02-24T00:00:00-05:00", "event": "Winter Storm Warning", "eventCode": {"NationalWeatherService": ["WSW"], "SAME": ["WSW"]}, "expires": "2026-02-23T07:00:00-05:00", "geocode": {"SAME": ["037009", "037189", "051173", "051077"], "UGC": ["NCZ001", "NCZ018", "VAZ009", "VAZ015"]}, "headline": "Winter Storm Warning issued February 22 at 5:21PM EST until February 24 at 12:00AM EST by NWS Blacksburg VA", "id": "urn:oid:2.49.0.1.840.0.2eb0a01eada20641cb4b561b77af86f515967a84.001.1", "instruction": "If you must travel, keep an extra flashlight, food, and water in\nyour vehicle in case of an emergency. The latest road conditions for\nthe state you are calling from can be obtained by calling 5 1 1.\n\nPersons should consider delaying all travel. Motorists should use\nextreme caution if travel is absolutely necessary.", "language": "en-US", "messageType": "Update", "onset": "2026-02-22T17:21:00-05:00", "parameters": {"AWIPSidentifier": ["WSWRNK"], "BLOCKCHANNEL": ["EAS", "NWEM", "CMAS"], "EAS-ORG": ["WXR"], "NWSheadline": ["WINTER STORM WARNING REMAINS IN EFFECT UNTIL MIDNIGHT EST MONDAY NIGHT tps://api.weather.gov/zones/forecast/NCZ018", "https://api.weather.gov/zones/forecast/VAZ009", "https://api.weather.gov/zones/forecast/VAZ015"], "areaDesc": "Ashe; Watauga; Smyth; Grayson", "category": "Winter Weather", "certainty": "Likely", "code": "IPAWSv1.0", "description": "Low pressure near Cape Hatteras, North Carolina, will strengthen\ninto a major winter storm as it moves north along the East Coast.\n\n* WHAT...Heavy snow mainly for elevations above 3500 Feet. Total\nsnow Total accumulations ranging from up to 3 inches in the lower\nelevations, to 5 to 12 inches above 3500 feet, especially in\nplaces like Beech Mountain, Mount Rogers and Flattop Mountain.\nWinds gusting as high as 50 mph.\n\n* WHERE...In North Carolina, Ashe and Watauga Counties. In Virginia,\nGrayson and Smyth Counties.\n\n* WHEN...Until midnight EST Monday Night.\n\n* IMPACTS...Roads, and especially bridges and overpasses, will\nlikely become slick and hazardous. Visibilities may drop below 1/4\nmile due to falling and blowing snow. Travel could be very\ndifficult. The hazardous conditions could impact the Monday\nmorning and evening commutes. Strong winds could cause tree damage.\n\n* ADDITIONAL DETAILS...Temperatures falling into the teens tonight,\ncombined with the wind, will result in wind chills near zero late\ntonight and Monday.", "effective": "2026-02-22T17:21:00-05:00", "ends": "2026-02-24T00:00:00-05:00", "event": "Winter Storm Warning", "eventCode": {"NationalWeatherService": ["WSW"], "SAME": ["WSW"]}, "expires": "2026-02-23T07:00:00-05:00", "geocode": {"SAME": ["037009", "037189", "051173", "051077"], "UGC": ["NCZ001", "NCZ018", "VAZ009", "VAZ015"]}, "headline": "Winter Storm Warning issued February 22 at 5:21PM EST until February 24 at 12:00AM EST by NWS Blacksburg VA", "id": "urn:oid:2.49.0.1.840.0.2eb0a01eada20641cb4b561b77af86f515967a84.001.1", "instruction": "If you must travel, keep an extra flashlight, food, and water in\nyour vehicle in case of an emergency. The lates
